import BookmarkIcon from "../icons/BookmarkFilledIcon";

const BookmarkedModuleCard: React.FC = () => {
    const dummyModuleCodes: string[] = [
        "CS1101s", "CS2030", "CS2040", "CS1231", "CS3219"
    ];

    const renderModuleCodes = () => dummyModuleCodes.map(moduleCode => {
        return (
            <div style={styles.moduleCode}>
                {moduleCode}
            </div>
        );
    });

    return (
        <div style={styles.container}>
            <div style={styles.header}>
                <div>
                    <BookmarkIcon />
                </div>
                <div>
                    Bookmarked Modules
                </div>
            </div>
            <div style={styles.moduleList}>
                {renderModuleCodes()}
            </div>
        </div>


    );
};

const styles = {
    moduleCode: {
        backgroundColor: "#289FA7",
        height: 70,
        width: 120,
        position: "absolute" as "absolute", // workaround for TS bug
        borderRadius: 12,
        display: "flex",
        justifyContent: "center",
        alignItems: "center",
        fontSize: "23px",
        boxShadow: "0px 4px 4px rgba(0, 0, 0, 0.25)"
    },
    container: {
        padding: 30,
        backgroundColor: "#223370",
        margin: "15px 0px",
        color: "#fff",
        borderRadius: 15,
        boxShadow: "0px 8px 8px rgba(0, 0, 0, 0.25)",
        marginBottom: 15,
        display: "flex",
        alignContent: "flex-start",
        alignItems: "center",
    },
    header: {
        display: "flex",
        justifyContent: "space-between"
    },
};

export default BookmarkedModuleCard;
